import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Button from "./Login/Button";
import Inputfield from "./Login/Inputfield";
import Container from "react-bootstrap/Container";

const Navbar1 = () => {
  return (
    <div>
      <Navbar bg="black" variant="dark " className="black">
        <Navbar.Brand href="#home">
          <Button variant="secondary" text="ME" onClick={registLogin}></Button>
        </Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Entdecke</Nav.Link>
          <Nav.Link href="#features">Trends</Nav.Link>
        </Nav>
      </Navbar>

      <Container className="border p-4 hide" id="loginOrRegist">
        <Inputfield
          ueberschrift="Username"
          type="text"
          id="username"
          placeholder="zb. beispielname"
        ></Inputfield>
        <Inputfield
          ueberschrift="Passwort:"
          type="password"
          id="Userpasswort"
          placeholder="zb. beispielpasswort"
        ></Inputfield>
        <Inputfield
          ueberschrift="E-mail:"
          type="email"
          id="email"
          placeholder="zb. beispiel@beispiel.com"
        ></Inputfield>
        <Button variant="secondary" text="Registrieren"></Button>
      </Container>
    </div>
  );
};

function registLogin() {
  showInFrot("loginOrRegist");
}

function showInFrot(id) {
  document.getElementById(id).classList.remove("hide");
  document.getElementById(id).classList.add("inFront");
  document.getElementById("hintergrund").classList.remove("hide");
  document.getElementById("hintergrund").classList.add("inFront");
  centerElement(id);
}

function centerElement(id) {
  document.getElementById(id).style.top = "100px";
}
export default Navbar1;
